import React, { Component } from "react";
import Swiper from "react-id-swiper";
import { Container } from "react-bootstrap";

class Gallery extends Component {
    render() {
        const params = {
            slidesPerView: "auto",
            spaceBetween: 30,
            pagination: {
                el: ".swiper-pagination",
                clickable: true
            }
        };
        return (
            <div>
                <Container className="mt-4 mb-5 pb-5">
                <Swiper {...params}>
                   <img src="https://i.pinimg.com/564x/6a/d1/73/6ad1734962b2fa0a6f5fbf49f32bb26b.jpg" className="img-fluid" alt="slide"/>
                </Swiper>
                </Container>
            </div>
        );
    }
}

export default Gallery;
